    [],nt"revision_timestamp": "2016-07-27T23:02:33.867418",nt"name": "nowitna-nwr-goose-surveys-1988",nt"isopen":
    false,nt"url": null,nt"notes": "Both aerial and river float goose surveys
    were conducted on the Nowitna NWR in 1988 to document migration chronology and peak
    numbers and to index production. Break-up and the peak spring goose migration period
    occurred in late April - early May on the refuge. Peak numbers of white-fronted
    geese and Canada geese were recorded on April 29th and May 6th, respectively. Float
    and aerial surveys of the Nowitna River and data collected during the refuge's annual
    duck production survey documented white-fronted goose production from previous years.
    Management recommendations for future surveys are presented.",nt"license_title":
